keysDown = {};\
\
-- redirect a call to this function from the party object's onDrawGui(g) hook\
function party_onDrawGui(g)\
\
   if ( qb_script ~= nil and qb_script.onDrawGui ~= nil ) then\
   qb_script.onDrawGui(g);\
   end\
\
   if not(activateHooks) then return; end\
\
   -- Open door key hook\
   if g.keyDown(\"z\") then\
      if not(keysDown[\"z\"]) then\
         hooks.script.toggleAhead();\
         keysDown[\"z\"] = true;\
      end\
   else\
      if keysDown[\"z\"] then\
         keysDown[\"z\"] = false;\
      end\
   end\
   \
   -- Kill key hook\
   if g.keyDown(\"k\") then\
      if not(keysDown[\"k\"]) then\
         hooks.script.killMonsterAhead();\
         keysDown[\"k\"] = true;\
      end\
   else\
      if keysDown[\"k\"] then\
         keysDown[\"k\"] = false;\
      end\
   end\
   \
   -- Heal key hook\
   if g.keyDown(\"h\") then\
      if not(keysDown[\"h\"]) then\
         party.party:heal();\
         keysDown[\"h\"] = true;\
      end\
   else\
      if keysDown[\"h\"] then\
         keysDown[\"h\"] = false;\
      end\
   end\
\
end\
\
function toggleAhead()\
   local dx, dy = getForward(party.facing);\
   for e in fix.script.newEntitiesAt(party.level, party.x, party.y) do\
      if e.setDoorState and e.facing == party.facing then e:toggle();   end\
   end\
   for e in fix.script.newEntitiesAt(party.level, party.x + dx, party.y + dy) do\
      if e.setDoorState and e.facing == (party.facing + 2) % 4 then e:toggle(); end\
      if e.setPitState then e:toggle(); end\
   end\
end\
\
function killMonsterAhead()\
   local dx, dy = getForward(party.facing);\
   damageTile(party.level, party.x + dx, party.y + dy, party.facing, 125, \"physical\", 9999);\
end\
