script_entity_1.script:setSource("--This is a global Script_Entity that controls alot of the main coding in this dungeon.\
holdingcell = false\
donetalking = 0\
\
function setupgame()\
      --My  Defualt Setup\
      timer_3.timer:stop()\
      timer_4.timer:stop()\
      timer_6.timer:stop()\
      party.party:getChampion(2):setEnabled(false)\
      party.party:getChampion(3):setEnabled(false)\
      party.party:getChampion(4):setEnabled(false)\
\
      --Nothing is done here this is simply here for you to edit if you want.\
end\
function startgame()\
      --My Defualt code to be executed when the game starts.\
      hudPrint(\"Slave Master: Get Ready to be teleported to a holding cell!\")\
\
      --Add your things here to be executed when the game starts.\
end\
function every3seconds()\
      --This is my defualt code to be executed every 3 seconds game time.\
      if holdingcell == false then\
         slave.monster:setHealth(0)\
         slave.controller:damage(1)\
         slave.controller:damage(1)\
         hudPrint(\"Stuff\")\
      end\
      \
      --Add your things here to be executed every 3 seconds game time.\
end\
function holdingcell()\
      --This is my defualt code to be executed when holdingcell function is called.\
      holdingcell = true\
\
      --Add your things here to be executed when holdingcell function is called.\
end\
function slavetalk()\
      hudPrint(\"Slave: I Don't like the way you act!\")\
end\
function slavetalk2()\
      hudPrint(\"Slave: Get away from me filth!\")\
end\
function slavetalk3()\
      hudPrint(\"Slave: I said get away from me!\")\
      donetalking = donetalking + 1\
      if donetalking == 2 then\
      hudPrint(\"Slave Master: Put them in there cells, the'd be locked up better there!\")\
      timer_3.timer:start()\
      end\
end\
function slavetalk4()\
      hudPrint(\"*Whisper* Slave: Hey I've got a plan to get us out of here.\")\
end\
function slavetalk5()\
      hudPrint(\"*Whisper* Slave: Trust me there's a big fight going on and thats why were in here.\")\
end\
function slavetalk6()\
      hudPrint(\"*Whisper* Slave: If we wait for the right moment we can break our cell doors open!\")\
      donetalking = donetalking + 1\
      if donetalking == 2 then\
      hudPrint(\"Slave Master: Put them in there cells, the'd be locked up better there!\")\
      timer_3.timer:start()\
      end\
end\
function goodluck()\
      hudPrint(\"Rubert: Let's get going!\")\
      hudPrint(\"Rubert: By the way my name is Rubert!\\nRubert Has joined your party!\")\
      party.party:getChampion(2):setEnabled(true)\
      party.party:getChampion(2):gainExp(3)\
end")
