   force_field_1.controller:deactivate()\
   force_field_2.controller:deactivate()\
   bossfight1.bossfight:addMonster(boss1.monster)\
   bossfight1.bossfight:addMonster(boss2.monster)\
   script_entity_2.script.sleep()\
end\
function bossdead()\
         bossfight1.bossfight:deactivate()\
         hudPrint(\"ARRRRRRRRRRRRRGGGGG!\") \
         hudPrint(\"You haven't seen the last of us!\")\
         hudPrint(\"Zarchton Brothers are dead!\")\
         hudPrint(\"Rose: That was easier then expected....\")\
         cluster_1:destroy()\
         cluster_2:destroy()\
         cluster_3:destroy()\
         bossdead = true\
end\
function sleep()\
   if bossdead == false then\
      party.party:sleep(false)\
      script_entity_2.script.sleep()\
   end\
end")
